import React from 'react';
import { Grommet, Footer } from 'grommet';
import { AppBar, Collapsable,ULogin } from './component/AppBar';
import { SimpleFooter } from './component/SimpleFooter';

const theme = {
  global: {
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};
function App() {
  return (
    <Grommet theme={theme}>
    <Collapsable></Collapsable>
   <SimpleFooter></SimpleFooter>
    </Grommet>
  );
}

export default App;
